import shopActionTypes from './shop-action-types'

const INITIAL_STATE= {
    collections: null
}

const shopReducer=(state = INITIAL_STATE, action) => {
    switch(action.type){
        case shopActionTypes.UPDATE_COLLECTION_DATA:
            return {
                ...state,
                collections: null
            }
        default:
            return state 
    }
}

export default shopReducer
